// The SLH-DSA Hypertree test
module pslhdsa

import encoding.hex

struct HypertreeTest {
	m           string
	skseed      string
	pkseed      string
	pkroot      string
	idxtreehigh u32
	idxtreemid  u32
	idxtreelow  u32
	idxleaf     u32
	expect_sig  string
}

fn test_hypertree_sig() ! {
	tests := [
		HypertreeTest{'9f86d081884c7d659a2feaa0c55ad015a3bf4f1b2b0b822cd15d6c15b0f00a08', '00000000000000000000000000000000', 'ffffffffffffffffffffffffffffffff', '1feacb19619835f0637c3252d68ef7cd', 0, 0, 0, 0, ''},
		HypertreeTest{'9f86d081884c7d659a2feaa0c55ad015a3bf4f1b2b0b822cd15d6c15b0f00a08', 'ffffffffffffffffffffffffffffffff', '00000000000000000000000000000000', 'd0ae6456d27c8eb3f2bc8a92c5ac678b', 0, 0, 0, 0, ''},
	]
	c := new_context(.shake_128f)
	for item in tests {
		m := hex_decode(item.m)!
		skseed := hex_decode(item.skseed)!
		pkseed := hex_decode(item.pkseed)!
		pkroot := hex_decode(item.pkroot)!
		expect_sig := hex_decode(item.expect_sig)!
	}
}
